export default {
  props: {
    size: {
      type: Number,
      default: 50
    },
    stroke: {
      type: Number,
      default: 3.5
    },
    color: {
      type: String,
      default: '#ed424b'
    }
  },
  computed: {
    loadingSize() {
      const newSize = this.size + 'px'
      return {
        width: newSize,
        height: newSize
      }
    },
    loadingColor() {
      return {
        stroke: this.color
      }
    }
  }
}
